- package: libsbml5-dev
  description: System Biology Markup Language library - development files
  long_description: " LibSBML is a library designed to help you read, write, manipulate,\n
    translate, and validate SBML files and data streams. It is not an\n application
    itself (though it does come with many example programs),\n but rather a library
    you can embed in your own applications.\n .\n This package contains files necessary
    for development with libsbml.\n"
